                    <h2>Grow your business with</h2>
                    <h4>Thapa Technical</h4>
                    <p>We are team of talanted developer making website</p>
                    <NavLink to="/service"><button>Get Started</button></NavLink>
                </div>
                <div className="rightContent col-lg-6">
                    <img src="" />
                </div>
            </div>
        </>
    )
}



export default Home;
